import React from "react";
import "./footer.css"
import {FaHome} from "react-icons/fa";

const Footer = () => {
    return (
        <div className="footer">
            <div className="container">
                <div className="left">
                    <div className="location">
                        <FaHome size = {20} style={{color:"aliceblue", marginRight:"2rem"}}/>
                    </div>
                </div>
                <div className="right">

                </div>
            </div>
        </div>
    )
}

export default Footer;
